window.bookSummaryJSON = "<p><b>This brand-new unabridged audiobook of </b><b><i>The Return of the King</i></b><b>, the third and final part of J. R. R. Tolkien’s epic adventure </b><b><i>The Lord of the Rings</i></b><b>, is read by the BAFTA Award-winning actor, director, and author Andy Serkis. </b></p> <p>The armies of the Dark Lord are massing as his evil shadow spreads even wider. Men, Dwarves, Elves, and Ents unite forces to battle against the Dark. Meanwhile, Frodo and Sam struggle further into Mordor in their heroic quest to destroy the One Ring. The devastating conclusion of J. R. R. Tolkien’s classic tale of adventure, begun in <i>The Fellowship of the Ring </i>and <i>The Two Towers</i>.</p>"; 
